import React from 'react';
import './Timetable.css'; 

const timetableData = {
  CSE: [
    { day: 'Monday', time: '9:00 AM - 10:00 AM', subject: 'Data Structures' },
    { day: 'Monday', time: '10:00 AM - 11:00 AM', subject: 'Algorithms' },
    { day: 'Tuesday', time: '9:00 AM - 10:00 AM', subject: 'Operating Systems' },
    
  ],
  ECE: [
    { day: 'Monday', time: '9:00 AM - 10:00 AM', subject: 'Circuit Theory' },
    { day: 'Monday', time: '10:00 AM - 11:00 AM', subject: 'Digital Electronics' },
    { day: 'Tuesday', time: '9:00 AM - 10:00 AM', subject: 'Microprocessors' },
    
  ]
};

const Timetable = ({ branch }) => {
  const schedule = timetableData[branch] || [];
  
  return (
    <div className="timetable">
      <h2>{branch} Timetable</h2>
      <table>
        <thead>
          <tr>
            <th>Day</th>
            <th>Time</th>
            <th>Subject</th>
          </tr>
        </thead>
        <tbody>
          {schedule.map((entry, index) => (
            <tr key={index}>
              <td>{entry.day}</td>
              <td>{entry.time}</td>
              <td>{entry.subject}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

